import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Home"; // Assure-toi que ce fichier existe

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<h1>Page de Connexion</h1>} />
        <Route path="/register" element={<h1>Page d'Inscription</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
